import React from 'react'
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";

const Card = () => {
  return (
    <>
        
        <div className='cards'>
            <div className='item'>
                <div className='image'>
                    <img src=''/>
                    <i className='fas fa-map-marker-alt'></i>
                    
                </div>
            </div>
        </div>
    </>
  )
}

export default Card
